import { Button } from "antd";
import React, { Children } from "react";
import { NavLink } from "react-router-dom";

const Layout = (props) => {
  return (
    <React.Fragment>
      <nav>
        <ul className="list-unstyled d-flex ">
          <li>
            <NavLink to="/">Home</NavLink>
          </li>
          <li>
            <Button>Login</Button>
          </li>
          <li>
            <Button>Sign up</Button>
          </li>
        </ul>
      </nav>
      {props.childern}
    </React.Fragment>
  );
};

export default Layout;
